import React, { useState, useEffect } from 'react';
import { loginStudent } from './../services/studentService';

const StudentLogin = () => {
  const [credentials, setCredentials] = useState({ email: '', password: '' });
  const [studentInfo, setStudentInfo] = useState(null);

  const handleChange = (e) => {
    setCredentials({ ...credentials, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await loginStudent(credentials);
      alert('Login successful!');
      setStudentInfo(response.data.student);
      console.log('Login Response:', response.data);
    } catch (error) {
      console.error('There was an error logging in!', error);
    }
  };

  useEffect(() => {
    console.log('Student Info:', studentInfo);
  }, [studentInfo]);

  return (
    <div className="container mt-5">
      {!studentInfo ? (
        <>
          <h2>Student Login</h2>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input
                type="email"
                className="form-control"
                id="email"
                name="email"
                value={credentials.email}
                onChange={handleChange}
                placeholder="Enter your email"
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="password">Password</label>
              <input
                type="password"
                className="form-control"
                id="password"
                name="password"
                value={credentials.password}
                onChange={handleChange}
                placeholder="Enter your password"
                required
              />
            </div>
            <button type="submit" className="btn btn-primary">Login</button>
          </form>
        </>
      ) : (
        <div className="mt-4">
          <h3>Student Details</h3>
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Attribute</th>
                <th>Details</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Student ID</td>
                <td>{studentInfo.student_id}</td>
              </tr>
              <tr>
                <td>Name</td>
                <td>{studentInfo.student_name}</td>
              </tr>
              <tr>
                <td>Phone Number</td>
                <td>{studentInfo.phone_no}</td>
              </tr>
              <tr>
                <td>Department</td>
                <td>{studentInfo.department}</td>
              </tr>
              <tr>
                <td>Marks</td>
                <td>{studentInfo.marks}</td>
              </tr>
              <tr>
                <td>Email</td>
                <td>{studentInfo.email}</td>
              </tr>
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default StudentLogin;
